import React, { useState } from 'react';
import './Profil.css'
import { useEffect } from 'react';

const MyProfil = () =>  {
    const [color1, setColor1] = useState('LiProfil');
    const [color2, setColor2] = useState('LiProfil');
    const [color3, setColor3] = useState('LiProfil');


    useEffect (()=> {
        console.log('1111')
    },[color1, color2, color3])

    const clicked = (e) => {
        setColor1('LiProfil')
        setColor2('LiProfil')
        setColor3('LiProfil')
        if (e.target.id === '1') 
            setColor1('LiFocus');
        if (e.target.id === '2')
        setColor2('LiFocus');
        if (e.target.id === '3')
            setColor3('LiFocus');
    };

    return (
        <div className="PageProfil">
            <div className="NavProfil">
                <ul className="UlProfil">
                    <li className="LiProfil" id='1' onClick={clicked}>Mes informations</li>
                    <li className="LiProfil" id='2' onClick={clicked}>Mes commandes</li>
                    <li className="LiProfil" id='3' onClick={clicked}>Ma Liste</li>
                </ul>
            </div>

        </div>
    );
};

export default MyProfil;
